INSERT INTO `blog` (`id`, `uid`, `title`, `text`, `time`, `del`, `reads`) VALUES
(1, 1, 'Тестовая новость', 'Просто тест [li]  background-repeat: no-repeat;[/li][li]  width: 200px;[/li][li]  height: 67px;[/li][li]  margin-top: -5px;[/li][li]  background-size: cover;[/li]', 1434310529, 1, 6),
(2, 1, 'Официальный запуск проекта', 'Сегодня состоялось официальное открытие проекта [url=http://Piar.name]Piar.name[/url]﻿\n\n\n[b]Piar.Name [/b]— это твой партнер для продвижения социальной сети ВКонтакте.\nМы разработали быстрый, удобный и безопасный сервис для вас.\n\nНаша цель - сделать сервис первым в своей сфере, предлагающий качественное продвижение.\n\n[h1]С помощью Piar.Name, Вы сможете:[/h1][ul][li]Качественно продвигать свои услуги.[/li][li]Выписывать штрафы злоумышленникам, которые например подписались и отписались.[/li][li]Похвастаться результатом перед друзьями.[/li][li]Раскручивать закрытые группы[/li][/ul]', 1434729921, 0, 145);
