INSERT INTO `pages` (`id`, `uid`, `name`, `short_url`, `time`, `ip`, `browser`, `text`, `del`) VALUES
(1, 0, 'Правила', 'rules', 1380282317, '212.109.30.249', 'Google Chrome 25.0.1364.172', '[h1]Правила пользования сайтом Piar.Name[/h1]Регистрируясь в системе Piar.Name, Вы соглашаетесь с правилами сервиса.\nНастоятельно рекомендуем ознакомиться с ними и соблюдать их в течение всего времени.\n\n[h1]1. Пользователи[/h1][ul][li][b]1.1.[/b] Регистрируясь на сайте, Вы указываете логин, пароль и e-mail.[/li][li][b]1.2.[/b] Указывая e-mail, Вы автоматически разрешаете отсылать Вам письма, напрямую связанные с Piar.Name. В случае, если e-mail неправильный, мы можем отказать Вам в предоставлении услуг.[/li][li][b]1.3. [/b]Администрация вправе заблокировать Ваш аккаунт, не указав причину блокировки.[/li][/ul][h1]\n2. Задания[/h1][ul][li][b]2.1. [/b]Выполняя задание, например «подписаться на Ивана Петрова», вы не должны отписываться в дальнейшем. В таком случае, мы вправе списать с Вас любое количество монет или заблокировать аккаунт без возможности разблокировки.[/li][li][b]2.2. [/b]Запрещено размещать задания, где присутствует "порно, накрутка голосов, порча, заработок, раскрутка и продвижение с помощью других сервисов". Наши фильтры следят за этим, однако обход их, может привести к занесению данного задания в черный список.[/li][li][b]2.3. [/b]Запрещено использовать краденные профили для продвижения, а так же профили без аватарок и с непонятными именами.[/li][li][b]2.4.[/b] Мы не даем Вам никаких гарантий, что заказанная услуга будет выполнена в срок. Всё зависит от объемов заказа и количества пользователей в онлайне.[/li][li][b]2.5. [/b]Запрещено использовать свой аккаунт от ВКонтакте на других сервисах/программах для накрутки, так как пользуясь сторонними сервисами/программами, страница ВКонтакте может быть заблокирована из-за некачественной накрутки, предоставляемой другими сервисами. Нарушив этот пункт, мы вправе заблокировать Ваш аккаунт на Piar.Name навсегда и занести Ваши ссылки в черный список. Мы предоставляем только качественное продвижение и не хотим, чтобы поступали жалобы, что накручено слишком много заблокированных пользователей по вине других сайтов.[/li][/ul][h1]\n3. Реферальная программа[/h1][ul][li][b]3.1.[/b] Приглашая друга по специальной ссылке, находящейся в разделе "[url=http://piar.name/settings/ref?menu=1]Реферальная программа[/url]﻿﻿", Вы получаете на счет +15 баллов.[/li][li][b]3.2.[/b] Приглашенные друзья должны быть активными на сервисе. В случае неактивности, мы вправе удалить реферала и списать за него полученные монеты.[/li][/ul]\n[h1]4. Заключительные положения[/h1][ul][li][b]4.1.[/b] Услуги системы оказываются «как есть» и «при возможности». Piar.Name не предоставляет никаких гарантий, прямо или косвенно, включая, помимо прочего, гарантии бесперебойной работы системы, гарантии качества услуг, пригодности их для той или иной цели и отсутствие нарушений.[/li][li][b]4.2.[/b] Piar.Name оставляет за собой право в любой момент изменить, приостановить или прекратить предоставление услуг полностью или частично, предварительно уведомив, либо без предварительного уведомления.[/li][li][b]4.3.[/b] Администрация сервиса оставляет за собой право изменять правила в любой момент, не уведомляя об этом пользователей.\n[/li][/ul]\nPiar.Name', 0),
(2, 0, 'О сервисе', 'about', 1380282853, '128.68.238.22', 'Safari 534.57.2', '[b]Piar.Name [/b]— это твой партнер для продвижения социальной сети ВКонтакте.\nМы разработали быстрый, удобный и безопасный сервис для вас.\n\nНаша цель - сделать сервис первым в своей сфере, предлагающий качественное продвижение.\n\n[h1]С помощью Piar.Name, Вы сможете:[/h1][ul][li]Качественно продвигать свои услуги.[/li][li]Выписывать штрафы злоумышленникам, которые например подписались и отписались.[/li][li]Похвастаться результатом перед друзьями.[/li][li]Раскручивать закрытые группы[/li][/ul][center]\n[img]/images/uploads/u965TrKxqTkA0O9.jpg[/img][/center]', 0),
(3, 0, 'Сотрудничество', 'cooperation', 1380286150, '212.109.30.249', 'Google Chrome 25.0.1364.172', '[h1]\n[/h1]\n\n[center]\nПо вопросам [u]сотрудничества[/u] пишите на наш почтовый ящик — [b]cooperation@montytool.ru[/b][/center]\n\n[h1]\n[/h1]', 1),
(4, 0, 'Вакансии', 'jobs', 1380289082, '212.109.30.249', 'Google Chrome 25.0.1364.172', '[center][h1]\n[/h1]\n\nНа данный момент нет свободных вакансий.[/center]\n[h1]\n[/h1]', 0),
(5, 0, 'Бесплатная накрутка лайков', 'likes', 1436459407, '62.133.185.204', 'Google Chrome 42.0.2311.152', '[h1]Бесплатная накрутка лайков\n[/h1]\nХотите иметь много лайков ВКонтакте,  но не знаете как это сделать? [b]Piar.Name[/b]поможет в этой ситуации! Благодаря [b][url=http://Piar.Name]Piar.Name[/url][/b], Вы сможете [b]бесплатно накрутить лайки ВКонтакте[/b] на записи, видеозаписи и фотографии.\n\nВы не потратите ни одной копейки на накрутку лайков. Всё что Вам необходимо, это выполнять задания и получать за это баллы. И потом эти накопленные баллы потратить на накрутку лайков.\n\nБлагодаря накрутке лайков, Вы сможете показать свою популярность и многие начнут интересоваться Вами.\n\nТеги:[i] накрутка лайков, лайки вк, накрутить лайки, накрутить лайки вк, бесплатная накрутка лайков, лайки , лайки , бесплатные лайки вк, бесплатный лайки , бесплатный лайки , как накрутить лайки,  халява на лайки, накрутка мне нравится[/i]', 0),
(6, 0, 'Бесплатная накрутка репостов', 'repost', 1436459639, '62.133.185.204', 'Google Chrome 42.0.2311.152', '[h1]Бесплатная накрутка репостов[/h1]Хотите иметь много репостов ВКонтакте, но не знаете как это сделать? Piar.name поможет в этой ситуации! Благодаря Piar.name, Вы сможете [b]бесплатно накрутить репосты[/b] записи, фотографии и видеозаписи ВКонтакте.\n\nВы не потратите ни одной копейки на накрутку репостов. Всё что Вам необходимо, это выполнять задания и получать за это баллы. И потом эти накопленные баллы потратить на накрутку репостов.\n\nБлагодаря накрутке репостов, Вы увеличиваете посещаемость, потому что при накрутке репостов, люди размещают Ваш материал у себя на странице и их друзья и подписчики видят этот репост. Соответственно, они зайдут туда, откуда репост и тем самым, Ваш материал увидят многие.\n\n\nТеги:[i] накрутка репостов, репосты вк, халявные репосты вк, как накрутить репосты вк, рассказать друзьям вк, как накрутить рассказать друзьям вк, накрутить рассказать друзьям вк, хочу много репостов, меня не репостят вк, накрутка рассказать друзьям[/i]', 0),
(7, 0, 'Бесплатная накрутка подписчиков', 'followers', 1436459805, '62.133.185.204', 'Google Chrome 42.0.2311.152', '[h1]Бесплатная накрутка подписчиков[/h1]Хотите иметь много подписчиков ВКонтакте,  но не знаете как это сделать? [b]Piar.Name [/b]поможет в этой ситуации! Благодаря [b][url=http://vkmix.ru/]P[/url]iar.Name[/b], Вы сможете [b]бесплатно накрутить подписчиков [/b]ВКонтакте.\n\nВы не потратите ни одной копейки на накрутку подписчиков. Всё что Вам необходимо, это выполнять задания и получать за это баллы. И потом эти накопленные баллы потратить на накрутку подписчиков.\n\nБлагодаря накрутке подписчиков, о Вашей странице узнают многие, так как Вы повышаетесь в рейтинге. У Вас появятся много поклонников и завистников.\n\n\n[h1]Теги:[i] накрутка подписчиков, подписчики вк, подписчики , подписчики , подписчики вк, как накрутить подписчиков, хочу быть популярным, хочу быть популярной, повыситься в поиске вк, на меня никто не подписывается, хочу друзей, накрутка друзей, друзья вк, , подписки[/i][i] хочу быть популярной, повыситься в поиске вк, на меня никто не подписывается, хочу друзей, накрутка друзей, друзья вк, фолловеры, подписки[/i][i] накрутка друзей, друзья вк, фолловеры, подписки[/i]\n[/h1]', 0),
(8, 0, 'Бесплатная накрутка опросов', 'polls', 1436459876, '62.133.185.204', 'Google Chrome 42.0.2311.152', '[h1]Бесплатная накрутка опросов[/h1][h1]Хотите иметь много голосов в опросе ВКонтакте, но не знаете как это сделать? Piar.Name поможет в этой ситуации! Благодаря P[b]iar.Name[/b] Вы сможете [b]бесплатно накрутить опросы [/b]ВКонтакте.\n\nВы не потратите ни одной копейки на накрутку опросов. Всё что Вам необходимо, это выполнять задания и получать за это баллы. И потом эти накопленные баллы потратить на накрутку опросов.\n\nВоздействие через накрутку опросов - самый действенный способ склонить к нужному решению.\n\n\nТеги: [i]накрутка опросов, опросы вк, накрутить голоса в опросе, как накрутить опрос, опрос вк, не голосуют в опросе вк, хочу много голосов в опрос, голосование вк[/i]\n[/h1]\nТеги: [i]накрутка опросов, опросы вк, накрутить голоса в опросе, как накрутить опрос, опрос вк, не голосуют в опросе вк, хочу много голосов в опрос, голосование вк[/i][i] опрос, голосование вк[/i][/i]', 0);
